Guided by the book ‚ÄúThe Purpose Driven Life‚Äù by author & Pastor Rick Warren.
.
.
Hi Faith Fam! In today‚Äôs chapter Pastor Rick explains how we were created to become like Christ. From the very beginning, God intended for us to become more and more like Jesus. In fact, we are the only one of God‚Äôs creation that are made in the image of God. We are dignified because of this and our lives should reflect this dignity daily. In becoming like Christ there are three responsibilities:
.
1. Choose to let go of old ways of acting
2. We must change the way we think
3. Put on the character of Christ by developing new, godly habits.
.
.
It is only through the Holy Spirit that we experience the change we need to become more like Christ so we must cooperate through obedience to God. Moreover God uses his word, people, and circumstances to mold us. His word provides us with truth, his people provide support we need to grow, and circumstances provide the environment we need to practice Christlikeness. It‚Äôs important to remember that God does not intend for us to become like Christ overnight. It is a slow process of growth that happens gradually for the rest of our lives through the choices we make. Our growth finally comes to an end in heaven where we gain perfection.
.
.
As you reflect on this chapter, be comforted that God is way more interested in what you are than in what you do. Meaning your career will never outweigh your character. Live your life with direct focus on fulfilling God‚Äôs purposes, and allowing God to build your character. The goal is not to be God or a God because that will never ever happen. The goal is to be more Godly.
.
